import React from "react";
import { useState } from "react";
import axios from "axios";
import { useNavigate } from 'react-router-dom';

function Login() {
  const [usermsg, setUsermsg] = useState("");  // fillied from response
  const [otpoption, setOtpoption] = useState("0"); // fillied from response

  const [email, setEmail] = useState("");
  const [password, setPassword] = useState("");
  //const [mfaflag, setMfaflag] = useState("false");

  const [totp, setTotp] = useState("");
  const [isLoginDisabled, setLoginDisabled] = useState(false);
  const [isSendOtpDisabled, setSendOtpDisabled] = useState(true);


  /* const onOptionChange = e => {
   setOtpoption(e.target.value);
   
   //alert(mfaflag);
   //alert(otpoption);


 } */

  //////////////////
  async function handleSubmit(event) {
    event.preventDefault();
    var iotp = "0";
    if (otpoption == "") {
      setOtpoption("0");
    }
    if (totp !== "") {
      // alert("inside totp");
      iotp = totp;
    }
    alert("inside " + email + ' ' + password + ' ' + iotp + ' totp: ' + totp);
    try {
      const res = await axios.post("http://localhost:9000/api/user/login", {
        email: email,
        password: password,
        otp: iotp    //otpoption

      })
        .then((response) => {
          alert(response.data.username + ' ' + response.data.otpOption + ' ' + response.data.otp);
          if (response.data.token != null) {
            // alert(response.data.token);
            setUsermsg(response.data.token);
            setLoginDisabled(true);
            setSendOtpDisabled(true);

          }
          if (response.data.otpOption == "1") {
            // alert(response.data.token);
            setUsermsg("Please enter Time-based One Time Password generated in Authenticator App.");
            setLoginDisabled(true);
            setSendOtpDisabled(false);
          }
          if (response.data.otpOption == "2") {
            // alert(response.data.token);
            setUsermsg("Please enter One Time Password sent to your registered Email.Your OTP is " + response.data.otp);
            setLoginDisabled(true);
            setSendOtpDisabled(false);
          }

          //setUsermsg("");
          //setQrimg

          //setEmail("");
          //setPassword("");
          //setMfaflag("");


        }, (error) => {
          // alert(error);
          setUsermsg("Invalid credentials.");
          setLoginDisabled(false);
        });

    }
    catch (err) {
      //alert(err);
      // console.log(err);
      setUsermsg("Invalid credentials.");
    }

  }

  return (

    <div class="container mt-4">

      <div class="card" align="center">


        <p>&nbsp;</p>
        <h1>User Login</h1>
        <p>&nbsp;</p>
        <div class="card" align="center">
          <table align="center" width="50%"><tr><td>

            <label>{usermsg}</label>

          </td></tr></table>
        </div>
        <p>&nbsp;</p>
        <form onSubmit={handleSubmit} id="loginform">

          <label>Email : </label><br />
          <input type='text' class="from-control" name='email'
            value={email}
            onChange={(e) => setEmail(e.target.value)}
            placeholder="enter your email" required /><br />
          <label>Password : </label><br />
          <input type='password' class="from-control" name='password'
            value={password}
            onChange={(e) => setPassword(e.target.value)}
            placeholder="enter your password" required />
          <p>&nbsp;</p>

          <button type="submit" class="btn btn-primary" onclick="" disabled={isLoginDisabled}>Login</button>
          <div id="qrimgdiv" align="center">
            <p>

              <label>One Time Password : </label><br />
              <input type='text' class="from-control" disabled={isSendOtpDisabled} name='totp'
                value={totp}
                onChange={(e) => setTotp(e.target.value)}
              /><br />
              <button type="submit" class="btn btn-primary" onclick="handleSendOtp" disabled={isSendOtpDisabled}>SEND OTP</button>
            </p>

          </div>
        </form>
      </div>




    </div>



  );
}

export default Login;
